  return (
    <>
      <div
        className='   overflow-y-hidden bg-gray-100'
      
      >
        {/* Navbar */}
       
       <NavbarLogin/>
        {/* Navbar */}

        {/* Home */}
      
        {/* End Home & header */}

        {/* Features */}
        <Featuers/>
         {/* End Features */}

         {/* Contact */}
         <Contact/>
         {/* end contact */}


         {/* Login form */}
         {/* <Login/> */}
         {/* End Login form */}


      </div>
    </>
  );
}

export default LoginPage;
